		 function carusel_resizer(carusel){
		  	var ptn_cnt=5;
		  	if($(window).width()<1140) ptn_cnt=4;
		  	if(carusel.hasClass('team_carusel') || carusel.hasClass('srv_carusel')) ptn_cnt+=1;
		  	$(carusel).children('div').width($('.ptn_carusel_cmpl').width()/ptn_cnt);
		 }

		  $('.ptn_carusel').each(function(){
		  	carusel_resizer($(this))
		  })

		  var resizeId;
		  $(window).resize(function() {
		      clearTimeout(resizeId);
		      resizeId = setTimeout(function(){
		      	$('.ptn_carusel').each(function(){
		      		carusel_resizer($(this))
		      	})
		      }, 500);
		  });

