$(function(){
	$('.complect_link').click(function(e){
		e.preventDefault();
	    $('.purple_glow').show().css('height',$(document).height());
	    $('.purple_pop').show().css({'top':$(window).scrollTop()+$(window).height()/2-$('.purple_pop').outerHeight()/2});
	})
	  $('.purple_glow, .purple_pop .pop_close').click(function(e){
	    e.preventDefault();
	    $('.purple_glow, .purple_pop').hide();
	  })
})